import React from 'react'
import Navbar from '../Component/Navbar';
import AltNavbar from '../Component/AltNavbar';

 const KayıtOl = () => {
  return (
    <><br/>
        <Navbar/><br/><br/><br/><br/><br/><br/>
        <div className='profil'>
            <div className='profil_ic'>
            <h6 style={{textAlign:"center"}}>MK.app'e<br/> Hoşgeldiniz</h6><br/>
            <input style={{height:50,width:250,marginLeft:20}} type='text' placeholder='Kullanıcı Adı' /><br/><br/>
            <input style={{height:50,width:250,marginLeft:20}} type='text' placeholder='E-posta Adresi' />


            </div>
        </div>
        <AltNavbar/>


    </>
  )
}

export default KayıtOl;
